export const TodoCard = (props) => {
  return (
    <tr className="todo is-completed">
      <td>{props.text}</td>
      <td>{props.isCompleted ? "Complete" : "Incompleted"}</td>
      <td className="todo-action">
        <button className="btn todo-btn">Change status</button>
      </td>
    </tr>
  );
};
